var state = {
	'queryState': userScore,
	'page': 1,
	'rows': 75,
	'window': 5
}

function pagination(querySet, page, rows){
	let trimStart = (page - 1) * rows
	let trimEnd = trimStart + rows

	let trimmedData = querySet.slice(trimStart, trimEnd)

	let pages = Math.ceil(querySet.length / rows)

	return {'querySet': trimmedData, 'pages': pages}
}


let scoreboard = ''
buildLeaderBoard()

function searchUser(value) {
	let filteredData = []
	for(let i=0; i < userScore.length; i++) {
		if(userScore[i].user.toLowerCase().includes(value.toLowerCase()))
			filteredData.push(userScore[i])
	}
	state.queryState = filteredData
	state.page = 1
	scoreboard = ''
	buildLeaderBoard()
}

function pageButtons(pages) {
	let wrapper_bottom = document.getElementById('pagination-wrapper-bottom')
	wrapper_bottom.innerHTML = ''

	let maxLeft = (state.page - Math.floor(state.window / 2))
	let maxRight = (state.page + Math.floor(state.window / 2))

	if (maxLeft < 1) {
	  maxLeft = 1
	  maxRight = state.window
	}
	if (maxRight > pages) {
	  maxLeft = pages - (state.window - 1)
	  
	  if (maxLeft < 1){
	  	maxLeft = 1
	  }
	  maxRight = pages
	}

	for (let page = maxLeft; page <= maxRight; page++) {
		wrapper_bottom.innerHTML += `<button value=${page} class="page btn btn-sm btn-primary">${page}</button>`
	}

	if (state.page != 1) {
	  wrapper_bottom.innerHTML = `<button value=${1} class="page btn btn-sm btn-primary">&#171; First</button>` + wrapper_bottom.innerHTML
	}

	if (state.page != pages) {
	  wrapper_bottom.innerHTML += `<button value=${pages} class="page btn btn-sm btn-primary">Last &#187;</button>`
	}

	$('.page').click(function() {
		scoreboard = ''
		window.scroll({
		  top: 0, 
		  left: 0, 
		  behavior: 'smooth'
		});
		state.page = Number($(this).val())
		buildLeaderBoard()
	})
}



